css:
@-moz-document domain("nitrotype.com") {
body {
    background: none;
}
html {
    background: fixed url(https://wallpapercave.com/wp/wp4653144.jpg), #33DDFF;
    background-size: 100%
}
.card--grit {
    background: none;
}
.bg--gradient {
    background: fixed;
}

.theme--pDefault .profile-bg
{
    background:url("https://wallpaperaccess.com/full/192924.jpg") top left repeat, linear-gradient(0deg,#2d2e2e 60%, #fff 100%);
    color: #d3d3d3;
    background-size: 100%
 }

.theme--pDefault .profile-bgHead
{
 background:url("https://wallpaperaccess.com/full/192924.jpg") top left repeat, linear-gradient(0deg,#2d2e2e 60%, #fff 100%);
    color: #d3d3d3;
    background-size: 100%
 }

.theme--pDefault.is-gold .profile-bg
{
 background:url("https://wallpaperaccess.com/full/192924.jpg") top left repeat, linear-gradient(0deg,#2d2e2e 60%, #fff 100%);
    color: #d3d3d3;
    background-size: 100%
 }
.card--a {
    background-color: #fff0;
    color: #fff;
}

.dash-copyContainer {
    background: #110066;
    box-shadow: 0 1px 157px 10px rgba(66, 31, 196, .71);
}
.dash-copy {
    color: #FFD500;
    font-size: 19px;
}

}
